@Component({
  selector: 'app-bar',
  templateUrl: './bar.component.html',
  styleUrls: ['./bar.component.css']
})
export class BarComponent {

    Accueil="Accueil";
    Règles="Règles";
    Contact="Contact";

}
<div class="centered">
    <div class="BarComponent " >
        <input  type="button" class="text-blue-600" value=accueil>
        <input type="button" class="text-blue-600" value=règles>
        <input type="button" class="text-blue-600" value=contact>
    </div>
</div>
